import React from 'react';
import '../C_login/style_login.css';
import icon_email from '../C_login/icons/icon_email.png';

function InvalidMsg(textbox) { 
  
  if (textbox.value === '') { 
      textbox.setCustomValidity 
            ('Entering an email-id is necessary!'); 
  } else if (textbox.validity.typeMismatch) { 
      textbox.setCustomValidity 
            ('Please enter an email address which is valid!'); 
  } else { 
      textbox.setCustomValidity(''); 
  } 

  return true; 
} 

function Email() {
  
    return (    
      <div class="login_email"> 
        <img src={icon_email} className="icon" alt="icon" />
        <input type="email" id="emailId" pattern=".+@ahduni.edu.in" placeholder="Your ahduni email" autoFocus
         oninvalid="InvalidMsg(this);" oninput="InvalidMsg(this);" required="required" 
        ></input>
      </div>
    );
  }
  
  export default Email;
